import { useState } from 'react';
import React from 'react';
import * as style from './styles';

export default function Matrix() {
  const [question, setQuestion] = useState('');
  const [answer, setAnswer] = useState('');
  const handleBlockClick = () => {};

  const blockGrids = Array.from(Array(9));
  let blockIndex = 0;
  for (let i = 0; i < 9; i++) {
    blockGrids[i] = (
      <style.Squares
        key={blockIndex}
        onClick={() => handleBlockClick(blockIndex)}
        style={{ width: 50, height: 50, backgroundColor: '#fff' }}
      />
    );
    blockIndex++;
  }

  const blockGrid = Array.from(Array(3), () => new Array(3));
  // let blockIndex = 0;
  for (let i = 0; i < 3; i++) {
    for (let j = 0; j < 3; j++) {
      blockGrid[i][j] = (
        <style.Squares
          key={blockIndex}
          onClick={() => handleBlockClick(blockIndex)}
          style={{ width: 50, height: 50 }}
        />
      );
      blockIndex++;
    }
  }
  return (
    <style.Squares>
      <style.SquareRow>
        {/* {blockGrids.map((row, index) => (
          <style.Squares
            key={blockIndex}
            onClick={() => handleBlockClick(blockIndex)}
          />
        ))} */}
        {blockGrids}
        <style.Square />
      </style.SquareRow>
    </style.Squares>
  );
}
